import React, { useState } from 'react';

import Login from '../components/Login';
import CreateAccount from '../components/CreateAccount';
import NavBar from '../components/NavBar';
import { Link } from 'react-router-dom';

const LoginPage = () =>
{
    const [show,setShow] = useState(true);

    return(
        <div id="MainPage">
            <div id="NavBar">
                    <NavBar />
            </div>
            <div id="LoginPageDiv">

                <div id="LoginInternalElements">
                {
                    show? 
                        <div>
                            <h1 id="user-authetication-title">Login</h1>
                            <Login />
                            {/* <Link onClick={()=>setShow(false)}>No Account? Create One!</Link> */}
                        </div>:
                        <div>
                            <h1 id="user-authetication-title">COP 4331 MERN Stack Demo</h1>
                            <CreateAccount />
                            {/* <Link onClick={()=>setShow(true)}>Already have an Account? Sign In!</Link> */}
                        </div>
                        
                }     
                </div>              
            </div>
        </div>
    );
};
export default LoginPage;
